sys_variable_value.value:
(function execute(inputs, outputs) {
    var data = new Array();
    var document;
    var documents = new Object();

    if (inputs.statuscode == '200') {
        try {
            var str = inputs.responseBody;
            var namespace = str.replace(/['"]+/g, '');
            var document = new Object();
            document.label = namespace;
            document.name = namespace;
            data.push(document);
        } catch (ex) {
            var dummyDoc = new Object();
            dummyDoc.label = '<No Namespace retrieved>';
            dummyDoc.name = null;
            data.push(dummyDoc);
        } finally {
            documents.data = data;
            outputs.documents = documents;
            outputs.status = "Success";
        }
    } else {
        var errMsgs = new OciObjectStorageManagement_ErrorHandler().errorHandler(inputs.responseBody);
        outputs.error_message = errMsgs[0];
        outputs.status = errMsgs[1];
    }
})(inputs, outputs);

